import { useState } from "react"

const Events = () => {

    const [events, setEvents] = useState([
        {
            id: 1,
            text: 'Birthday event',
            time: 'abcd',
            registered: false,
        },
        {
            id: 2,
            text: 'Anniversary event',
            time: 'abcd',
            registered: true,
        }
    ])

    return (
        <div className="events">
            {events.map((eve) => (<h3 key={eve.id}>{eve.text}</h3>))}
        </div>
    )
}

export default Events
